import math

def generate_trig_table(angle_step=0.7894, max_angle=360):
    trig_table = []
    angle = 0
    while angle <= max_angle:
        angle = math.radians(angle)
        cosine = math.cos(angle)
        sine = math.sin(angle)
        trig_table.append({'angle': angle, 'cosine': cosine, 'sine': sine})
        angle += angle_step
    return trig_table

